INSERT INTO `news_posts` VALUES (1,'La gran noticia','asdasd','<div>Quick start</div>\r\n<p>Looking to quickly add Bootstrap to your project? Use BootstrapCDN, provided for free by the folks at StackPath. Using a package manager or need to download the source files? <a href=\"https://getbootstrap.com/docs/4.1/getting-started/download/\">Head to the downloads page.</a></p>\r\n<div>CSS</div>\r\n<p>Copy-paste the stylesheet <code class=\"highlighter-rouge\">&lt;link&gt;</code> into your <code class=\"highlighter-rouge\">&lt;head&gt;</code> before all other stylesheets to load our CSS.</p>\r\n<div class=\"bd-clipboard\">&nbsp;</div>\r\n<figure class=\"highlight\">\r\n<pre><code class=\"language-html\" data-lang=\"html\"><span class=\"nt\">&lt;link</span> <span class=\"na\">rel=</span><span class=\"s\">\"stylesheet\"</span> <span class=\"na\">href=</span><span class=\"s\">\"https://stackpath.bootstrapcdn.com/bootstrap/4.1.3/css/bootstrap.min.css\"</span> <span class=\"na\">integrity=</span><span class=\"s\">\"sha384-MCw98/SFnGE8fJT3GXwEOngsV7Zt27NXFoaoApmYm81iuXoPkFOJwJ8ERdknLPMO\"</span> <span class=\"na\">crossorigin=</span><span class=\"s\">\"anonymous\"</span><span class=\"nt\">&gt;</span></code></pre>\r\n</figure>\r\n<div>JS</div>\r\n<p>Many of our components require the use of JavaScript to function. Specifically, they require <a href=\"https://jquery.com\">jQuery</a>, <a href=\"https://popper.js.org/\">Popper.js</a>, and our own JavaScript plugins. Place the following <code class=\"highlighter-rouge\">&lt;script&gt;</code>s near the end of your pages, right before the closing <code class=\"highlighter-rouge\">&lt;/body&gt;</code> tag, to enable them. jQuery must come first, then Popper.js, and then our JavaScript plugins.</p>\r\n<p>We use <a href=\"https://blog.jquery.com/2016/06/09/jquery-3-0-final-released/\">jQuery&rsquo;s slim build</a>, but the full version is also supported.</p>\r\n<div class=\"bd-clipboard\">&nbsp;</div>\r\n<figure class=\"highlight\">\r\n<pre><code class=\"language-html\" data-lang=\"html\"><span class=\"nt\">&lt;script </span><span class=\"na\">src=</span><span class=\"s\">\"https://code.jquery.com/jquery-3.3.1.slim.min.js\"</span> <span class=\"na\">integrity=</span><span class=\"s\">\"sha384-q8i/X+965DzO0rT7abK41JStQIAqVgRVzpbzo5smXKp4YfRvH+8abtTE1Pi6jizo\"</span> <span class=\"na\">crossorigin=</span><span class=\"s\">\"anonymous\"</span><span class=\"nt\">&gt;&lt;/script&gt;</span>\r\n<span class=\"nt\">&lt;script </span><span class=\"na\">src=</span><span class=\"s\">\"https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.14.3/umd/popper.min.js\"</span> <span class=\"na\">integrity=</span><span class=\"s\">\"sha384-ZMP7rVo3mIykV+2+9J3UJ46jBk0WLaUAdn689aCwoqbBJiSnjAK/l8WvCWPIPm49\"</span> <span class=\"na\">crossorigin=</span><span class=\"s\">\"anonymous\"</span><span class=\"nt\">&gt;&lt;/script&gt;</span>\r\n<span class=\"nt\">&lt;script </span><span class=\"na\">src=</span><span class=\"s\">\"https://stackpath.bootstrapcdn.com/bootstrap/4.1.3/js/bootstrap.min.js\"</span> <span class=\"na\">integrity=</span><span class=\"s\">\"sha384-ChfqqxuZUCnJSK3+MXmPNIyE6ZbWh2IMqE241rYiqJxyMiZ6OW/JmZQ5stwEULTy\"</span> <span class=\"na\">crossorigin=</span><span class=\"s\">\"anonymous\"</span><span class=\"nt\">&gt;&lt;/script&gt;</span></code></pre>\r\n</figure>\r\n<p>Curious which components explicitly require jQuery, our JS, and Popper.js? Click the show components link below. If you&rsquo;re at all unsure about the general page structure, keep reading for an example page template.</p>\r\n<p>&nbsp;</p>\r\n<div style=\"color: #bbbbbb; background-color: #282c34; font-family: \'Droid Sans Mono\', \'monospace\', monospace, \'Droid Sans Fallback\'; font-weight: normal; font-size: 14px; line-height: 19px; white-space: pre;\">\r\n<div><span style=\"color: #bbbbbb;\">&lt;</span><span style=\"color: #e06c75;\">script</span> <span style=\"color: #d19a66;\">href</span><span style=\"color: #bbbbbb;\">=</span><span style=\"color: #98c379;\">\"https://cdn.jsdelivr.net/npm/sweetalert2@7.32.2/dist/sweetalert2.all.min.js\"</span><span style=\"color: #bbbbbb;\">&gt;</span> <span style=\"color: #bbbbbb;\">&lt;/</span><span style=\"color: #e06c75;\">script</span><span style=\"color: #bbbbbb;\">&gt;</span></div>\r\n<div>&nbsp;</div>\r\n</div>','Publicado','2018-12-13 14:12:00',7,NULL,NULL,'Público','De las buenas',NULL,'2018-12-13 14:49:40','2018-12-13 14:49:40',NULL,1);
